Pres. Trump said children are “almost immune” from COVID-19, in unsubstantiated claims about how the virus impacts kids.

This comes as a school applauded last week by VP Pence for re-opening, is now forced to quarantine some of its fourth graders.

@PaulaReidCBS reports https://t.co/PneUAY1Jr9

Florida became the second state to surpass 500,000 coronavirus cases just as the debate over how to safely reopen schools intensifies.

In Chicago, the nation’s third-largest school district, 350,000 students will begin the academic year online.

@BojorquezCBS has more https://t.co/Gkpv7hrpvx

Several Beirut port officials are under house arrest after explosions shook the city Tuesday. If they are found responsible, Lebanon’s president says they could face “the harshest punishment.”

The blasts killed at least 137 and injured as many as 5,000.

